              type="button"
              className="btn btn-primary"
              onClick={handleClick}
            >
              View Code
            </button> */}



<BrowserRouter >
    <Switch>
      {indexRoutes.map((prop, key) => {
        return <Route to={prop.path} component={prop.component} key={key} />;
      })}
    </Switch>
  </BrowserRouter>
            {/* <Link to={props.url} className="btn btn-primary">
              View Code
            </Link> */}
          </div>
        </div>
      </div>
    </>
  );
};

export default Card;
